// SPDX-License-Identifier: MIT
pragma solidity ^0.8.24;
import "@openzeppelin/contracts/utils/TransientSlot.sol";
import "@openzeppelin/contracts/utils/SlotDerivation.sol";
contract ReentrantLock {
    using TransientSlot for *;
    string public constant ERC7201_NAMESPACE = "ReentrantLock.Namespace";
    bytes32 private immutable _COUNTER_SLOT;
    constructor () {
        _COUNTER_SLOT = SlotDerivation.erc7201Slot(ERC7201_NAMESPACE);
    }
    bytes32 internal constant _LOCK_SLOT = 0xf4678858b2b588224636b8522b729e7722d32fc491da849ed75b3fdf3c84f542;
}

